import InvestInput from "../Investment/InvestInput";

import CardStyles from '../../styles/Card.module.css'
function Card(props) {
    const classComponent = CardStyles['card-container'] + props.children
    return (
        <div className={classComponent}>
            <InvestInput />
        </div>
    )
}

export default Card;
